import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { tap } from 'rxjs/operators';
import { AuthToken } from '../../model/auth-token.model';
import { RequestService } from '../request/request.service';
import { JwtService } from './jwt.service';

@Injectable({
  providedIn: 'root',
})
export class AuthService {
  constructor(private request: RequestService, private jwt: JwtService) {}

  /**
   * Authenticate a user and get a token for the user
   *
   * @param username of the user
   * @param password associated to the user
   * @returns
   */
  authenticate(email: string, password: string): Observable<AuthToken> {
    return this.request
      .post<AuthToken>('authenticate', { email, password })
      .pipe(tap((u) => this.jwt.setToken(u.token)));
  }

  /**
   * Re-Authenticates a user. Only works if they have an existing token.
   *
   * @returns The new Auth Token object
   */
  reauthenticate(): Observable<AuthToken> {
    return this.request
      .post<AuthToken>('reauthenticate')
      .pipe(tap((u) => this.jwt.setToken(u.token)));
  }
}

import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class CommonService {
  /**
   * Will return the copied object of it's own instance.
   *
   * @param obj The object to be copied
   * @returns new object instance
   */
  copyObject(obj: any): any {
    return JSON.parse(JSON.stringify(obj));
  }

  /**
   * Formats the given date object or string. The default format being used is month/day/year.
   *
   * @param value The value to be formatted.
   * @returns The formatted string.
   */
  formatDate(value: Date | string): string {
    if (value === null) {
      return '-';
    }
    let dateValue;
    if (value instanceof Date) {
      dateValue = value;
    } else {
      dateValue = new Date(value);
    }

    const month =
      dateValue.getMonth() + 1 < 10
        ? `0${dateValue.getMonth() + 1}`
        : dateValue.getMonth() + 1;
    const day =
      dateValue.getDate() < 10
        ? `0${dateValue.getDate()}`
        : dateValue.getDate();
    const year = dateValue.getFullYear();

    return `${month}/${day}/${year}`;
  }

  /**
   * Formats the users name into a first name and last name basis.
   *
   * @param user The user object to be formatted.
   * @returns String of the formatted name.
   */
  getFormattedName(user: any): string {
    if (user.lastName) {
      return `${user.firstName} ${user.lastName}`.trim();
    } else {
      return `${user.firstName}`.trim();
    }
  }
}

import { Injectable } from '@angular/core';
import { Router } from '@angular/router';
import { JwtHelperService } from '@auth0/angular-jwt';
import { WebRole } from '../../model/common.model';
import { User } from '../../model/user.model';

export const TOKEN_NAME = 'token';

@Injectable({
  providedIn: 'root',
})
export class JwtService {
  constructor(
    private router: Router,
    private readonly jwtHelperService: JwtHelperService
  ) {}

  /**
   * Gets the raw token that is currently stored for the logged in user.
   *
   * @returns String of the raw json web token.
   */
  getToken(): string {
    return localStorage.getItem(TOKEN_NAME);
  }

  /**
   * Sets the users jwt token. Only called when the user is authenticated.
   *
   * @param token The token to set in the local storage.
   */
  setToken(token: string) {
    localStorage.setItem(TOKEN_NAME, token);
  }

  /**
   * Checks to see if the logged in user is authenticated already. If the users
   * token is expired then it will remove and route them to the login screen.
   *
   * @returns Boolean if the user is authenticated or not.
   */
  isAuthenticated() {
    if (localStorage.getItem(TOKEN_NAME) != null) {
      if (this.jwtHelperService.isTokenExpired()) {
        localStorage.removeItem(TOKEN_NAME);
        return false;
      }
      return true;
    } else {
      return false;
    }
  }

  /**
   * Gets a property from the jwt token. If the property does not exist on
   * the token then it will return null.
   *
   * @param value The value to get from the jwt token.
   * @param tokenOverride If the token override needs to be used over the stored value.
   * @returns The property on the jwt token.
   */
  get(value: any, tokenOverride?: string) {
    const reviewedToken = tokenOverride ? tokenOverride : this.getToken();
    return this.jwtHelperService.decodeToken(reviewedToken)[value];
  }

  /**
   * Gets the user id from the jwt token.
   *
   * @returns The user's id.
   */
  getUserId() {
    return Number(this.get('userId'));
  }

  /**
   * Gets the user webrole from the jwt token.
   *
   * @returns The user's webrole.
   */
  getWebRole() {
    return this.get('webRole') as keyof typeof WebRole;
  }

  getUser(): User {
    return {
      id: this.getUserId(),
      firstName: this.get('firstName'),
      lastName: this.get('lastName'),
      email: this.get('email'),
      webRole: this.getWebRole(),
    };
  }

  /**
   * Will log a user out of the application and route them to the login
   * page.
   */
  logOut() {
    localStorage.removeItem(TOKEN_NAME);
    this.router.navigate(['login']);
  }
}

import { Injectable } from '@angular/core';
import { Observable, Subject } from 'rxjs';
import { Notification } from '../../../model/notification.model';
import { RequestService } from '../../request/request.service';

@Injectable({
  providedIn: 'root',
})
export class NotificationService {
  readonly BASE_PATH = 'api/notification-app/notifications';
  private notificationListener: Subject<void> = new Subject<any>();

  constructor(private readonly requestService: RequestService) {}

  /**
   * Get a list of notifications for the given request
   *
   * @param params to filter request on
   * @returns observable of the returned request
   */
  getNotifications(params?: Map<string, string[]>): Observable<Notification[]> {
    return this.requestService.get<Notification[]>(this.BASE_PATH, params);
  }

  /**
   * This will get the notification for the given id.
   *
   * @param id The id of the notificaiton to get.
   * @returns Notification observable
   */
  getNotificationById(id: number): Observable<Notification> {
    return this.requestService.get<Notification>(`${this.BASE_PATH}/${id}`);
  }

  /**
   * This will mark the notification as read for the given id.
   *
   * @param id The id of the notitificaiton to read.
   * @returns Notification object that was read.
   */
  markNotificationRead(id: number): Observable<Notification> {
    return this.requestService.put<Notification>(
      `${this.BASE_PATH}/${id}/read`
    );
  }

  /**
   * This will delete the notification for the given id.
   *
   * @param id The notification id that needs deleted.
   * @returns Any object that is has completed.
   */
  deleteNotification(id: number): Observable<any> {
    return this.requestService.delete<any>(`${this.BASE_PATH}/${id}`);
  }

  /**
   * Watch for changes to the notifications trigger.
   *
   * @returns observeable with the change detected.
   */
  notificationChange() {
    return this.notificationListener.asObservable();
  }

  /**
   * Trigger an update for the notifications in the navbar
   */
  triggerNotificationUpdate() {
    this.notificationListener.next();
  }
}

