import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { UrlService } from '../url-service/url.service';

/**
 * Common Request Service
 *
 * @author Sam Butler
 * @since Dec 15, 2020
 */
@Injectable({
  providedIn: 'root',
})
export class RequestService {
  constructor(
    private readonly urlService: UrlService,
    private readonly http: HttpClient
  ) {}

  /**
   * Get request service that will add the given parameters provided
   * and call the given url.
   *
   * @param url to call
   * @param params params to add to endpoint
   * @returns observable of the passed in object
   */
  get<T>(url: string, params?: Map<string, string[]>): Observable<T> {
    let endpoint = `${this.urlService.getAPIUrl()}/${url}?`;
    if (params) {
      params.forEach((value, key) => {
        endpoint = `${endpoint}${key}=${value}&`;
      });
    }
    return this.http.get<T>(endpoint.slice(0, -1));
  }

  /**
   * Post the given body to the passed in endpoint
   *
   * @param url to post body too
   * @param body to be posted to the endpoint
   * @returns observable of the passed in object
   */
  post<T>(url: string, body?: any): Observable<T> {
    let endpoint = `${this.urlService.getAPIUrl()}/${url}`;
    return this.http.post<T>(endpoint, body);
  }

  /**
   * Put the given body to the passed in endpoint
   *
   * @param url to post body too
   * @param body to be posted to the endpoint
   * @returns observable of the passed in object
   */
  put<T>(url: string, body?: any): Observable<T> {
    let endpoint = `${this.urlService.getAPIUrl()}/${url}`;
    return this.http.put<T>(endpoint, body);
  }

  /**
   * Delete the given data for the url.
   *
   * @param url The url to delete from.
   * @returns observable of the passed in object
   */
  delete<T>(url: string): Observable<T> {
    let endpoint = `${this.urlService.getAPIUrl()}/${url}`;
    return this.http.delete<T>(endpoint);
  }

  /**
   * Gets the download body as a blob on the given endpoint.
   *
   * @param url to call.
   * @param params params to add to endpoint.
   * @returns Blob donwload of the passed in object.
   */
  download(url: string, params?: Map<string, string[]>): Observable<Blob> {
    let endpoint = `${this.urlService.getAPIUrl()}/${url}?`;
    if (params) {
      params.forEach((value, key) => {
        endpoint = `${endpoint}${key}=${value}&`;
      });
    }
    return this.http.get(endpoint.slice(0, -1), {
      responseType: 'blob',
    });
  }
}

import { Injectable } from '@angular/core';
import { RxStomp } from '@stomp/rx-stomp';
import { Message } from '@stomp/stompjs';
import { Observable } from 'rxjs';
import { map } from 'rxjs/operators';
import { Notification } from '../../model/notification.model';
import { JwtService } from '../auth/jwt.service';
import { UrlService } from '../url-service/url.service';
import { STOMP_SOCKET_CONFIG } from './stomp.config';

/**
 * Subscription service for listening to a socket and processing
 * the notification that is passed in.
 *
 * @author Sam Butler
 * @since August 11, 2022
 */
@Injectable({
  providedIn: 'root',
})
export class SubscriptionService extends RxStomp {
  private readonly SOCKET_URL = '/topic/notification';

  constructor(
    private readonly jwt: JwtService,
    private readonly urlService: UrlService
  ) {
    super();
  }

  /**
   * Initialize the socket connection.
   */
  init() {
    if (!this.active) {
      this.configure(STOMP_SOCKET_CONFIG);
      this.configure({
        brokerURL: `${this.urlService.getSocketAPIUrl()}?${this.jwt.getToken()}`,
      });
      this.activate();
    }
  }

  /**
   * This will listen to the websocket url for any request and show it to the
   * provided user.
   *
   * @param destination What socket path to listen too.
   * @returns Observable of the caught Notification object.
   */
  listen(destination?: string): Observable<Notification> {
    return super
      .watch(`${destination ? destination : this.SOCKET_URL}`)
      .pipe(map((res: Message) => JSON.parse(res.body)));
  }
}

import { Inject, Injectable } from '@angular/core';

/**
 * URL Service
 *
 * @author Sam Butler
 * @since Dec 15, 2020
 */
@Injectable({
  providedIn: 'root',
})
export class UrlService {
  constructor(@Inject('env') private env) {}

  /**
   * Get's the full API URL
   *
   * @returns string of the full API url
   */
  getAPIUrl(): string {
    if (this.env.isLocal) {
      return `http://${this.env.apiUrl}`;
    } else {
      return `https://${this.env.apiUrl}`;
    }
  }

  /**
   * Gets the API for socket calls
   *
   * @returns The url for the api web socket.
   */
  getSocketAPIUrl() {
    if (this.env.isLocal) {
      return `ws://${this.env.apiUrl}/api/subscription`;
    } else {
      return `wss://${this.env.apiUrl}/api/subscription`;
    }
  }
}

