import { NavigationEnd, Router } from '@angular/router';
import { Subject } from 'rxjs';
import { filter, takeUntil } from 'rxjs/operators';
import { GridColumnComponent } from './grid-column/grid-column.component';
import { GridPagerComponent } from './grid-pager/grid-pager.component';
import { GridSearchComponent } from './grid-search/grid-search.component';
import { GridShowAllComponent } from './grid-show-all/grid-show-all.component';

@Component({
  selector: 'ik-grid',
  templateUrl: 'grid.component.html',
})
export class GridComponent implements OnChanges, OnDestroy, AfterViewInit {
  @ContentChildren(GridColumnComponent) columns: QueryList<GridColumnComponent>;
  @ContentChild(GridPagerComponent) pager: GridPagerComponent;
  @ContentChild(GridShowAllComponent) showAll: GridShowAllComponent;
  @ContentChild(GridSearchComponent) search: GridSearchComponent;

  @Input() dataLoader: any[] = [];
  @Input() translationKey: any;
  @Input() pageSize = 15;
  @Input() padding = true;
  @Input() basePath = '';
  @Input() overflowEnabled = false;
  @Input() storageTag = 'gridCurrentPage';
  @Input() alwaysDestroy = false;

  @Output() rowClick = new EventEmitter<any>();

  gridContent = [[]];
  gridIndex = 0;

  loading = true;
  destroy = new Subject<void>();
  initialLoadComplete = false;

  constructor(
    private readonly router: Router,
    private changeDector: ChangeDetectorRef
  ) {}

  ngAfterViewInit() {
    this.checkDataLoader();
    this.changeDector.detectChanges();
    this.initialLoadComplete = true;
  }

  ngOnChanges() {
    if (this.initialLoadComplete) {
      this.checkDataLoader();
    }
  }

  checkDataLoader() {
    if (this.dataLoader) {
      this.initGrid();
    } else {
      this.loading = true;
    }
  }

  ngOnDestroy() {
    if (this.isNewAppRoute() || this.alwaysDestroy) {
      localStorage.removeItem(this.storageTag);
    }
    this.destroy.next();
  }

  initGrid() {
    this.gridIndex = Number(localStorage.getItem(this.storageTag)) | 0;
    this.loading = false;

    if (this.pager) {
      this.pager.initPager(
        this.dataLoader.length,
        this.gridIndex,
        this.pageSize,
        this.translationKey,
        this.storageTag
      );
    } else {
      this.gridIndex = 0;
    }

    if (this.showAll) {
      this.showAll.init(this.dataLoader.length);
    }

    if (this.search) {
      this.search.search.pipe(takeUntil(this.destroy)).subscribe(() => {
        this.loading = true;
        this.pager.updateRoute(0);
      });
    }

    this.getPageData();
    this.listenToRoute();
  }

  refresh() {
    this.loading = true;
  }

  listenToRoute() {
    this.router.events
      .pipe(
        filter((e) => e instanceof NavigationEnd),
        takeUntil(this.destroy)
      )
      .subscribe(() => this.onGridChange());
  }

  onGridChange() {
    this.gridIndex = Number(localStorage.getItem(this.storageTag));
    this.getPageData();
  }

  onRowClick(event: number) {
    this.rowClick.emit(
      this.dataLoader[event + this.gridIndex - this.gridContent.length]
    );
  }

  getPageData() {
    this.gridContent = [];

    for (let i = 0; i < this.pageSize && this.dataLoader[this.gridIndex]; i++) {
      this.gridContent.push(Object.values(this.getRowData(this.gridIndex++)));
    }

    if (this.pager) {
      this.pager.updatePageFooter(this.gridIndex);
    }
  }

  getRowData(index: number) {
    const arrayData = [];
    this.columns?.forEach((col) => {
      const val = this.dataLoader[index][col.field];
      arrayData.push(val ? val : '-');
    });
    return arrayData;
  }

  isDate(value: any) {
    if (typeof value === 'number') {
      return false;
    } else {
      let dateWrapper = new Date(value);
      return !isNaN(dateWrapper.getDate());
    }
  }

  isNewAppRoute() {
    return !this.router.url.includes(`/${this.basePath}`);
  }
}

import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'ik-grid-pager',
  templateUrl: 'grid-pager.component.html',
})
export class GridPagerComponent {
  dataLength: number = 0;
  translationKey: string = '';
  storageTag = 'gridCurrentPage';

  totalPages: number = 0;
  pageSize: number = 0;
  pageIndex: number = 0;
  pages: any;

  constructor(private readonly router: Router) {}

  initPager(
    length: number,
    index: number,
    size: number,
    key: string,
    tag: string
  ) {
    this.dataLength = length;
    this.pageIndex = index;
    this.pageSize = size;
    this.translationKey = key;
    this.storageTag = tag;
    this.setFooter();
  }

  setFooter() {
    this.totalPages = Math.ceil(this.dataLength / this.pageSize);
    this.updatePageFooter(this.pageIndex);
  }

  updateRoute(index: number) {
    localStorage.setItem(this.storageTag, `${index}`);
    this.router.onSameUrlNavigation = 'reload';
    this.router.navigate([], { state: { currentPage: index } });
  }

  pageClick(page: number) {
    this.pageIndex = page * this.pageSize - this.pageSize;
    this.updateRoute(this.pageIndex);
  }

  onNextPageClick() {
    if (this.pageIndex < this.dataLength) {
      this.updateRoute(this.pageIndex);
    }
  }

  onPreviousPageClick() {
    if (this.pageIndex > this.pageSize) {
      this.pageIndex =
        this.pageIndex - this.pageSize - this.calculatePageRowSize();
      this.updateRoute(this.pageIndex);
    }
  }

  calculatePageRowSize() {
    const resultsLeft = this.dataLength - this.pageIndex;
    return resultsLeft === 0 ? this.dataLength % this.pageSize : this.pageSize;
  }

  updatePageFooter(index: number) {
    this.pageIndex = index;

    const page = Math.ceil(this.pageIndex / this.pageSize);

    if (page === 1) {
      this.pages = [
        {
          pageNum: page,
          active: true,
        },
        {
          pageNum: page + 1,
          active: false,
        },
        {
          pageNum: page + 2,
          active: false,
        },
      ];
    } else if (page === this.totalPages) {
      this.pages = [
        {
          pageNum: page - 2,
          active: false,
        },
        {
          pageNum: page - 1,
          active: false,
        },
        {
          pageNum: page,
          active: true,
        },
      ];
    } else {
      this.pages = [
        {
          pageNum: page - 1,
          active: false,
        },
        {
          pageNum: page,
          active: true,
        },
        {
          pageNum: page + 1,
          active: false,
        },
      ];
    }
  }
}

